    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    (including the Edmunds Unit) outlines Refuge accomplishments from September through
    December of 1961. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and vegetation control. Resource
    management is outlined; topics include grazing, fur harvesting, and timber removal.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, violations, and safety. Items of interest, N-R forms,
    and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
